import React from "react";
import ReactDOM from "react-dom/client";
import "./App.css";
import App from "./App";
import { DataProvider } from './context/DataContext';

ReactDOM.render(
  <React.StrictMode>
    <DataProvider>
      <App />
    </DataProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
